// Dashboard.js
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { MoreVertical, Trash2, FileText, Upload, Printer } from "lucide-react";
import { Apple, BookOpen } from "lucide-react"; // Added icons

function Dashboard() {
  const navigate = useNavigate();
  const [recipes, setRecipes] = useState([]);
  const [menuOpenIndex, setMenuOpenIndex] = useState(null);

  useEffect(() => {
    const keys = Object.keys(localStorage);
    const validRecipes = [];

    keys.forEach((key) => {
      try {
        const val = JSON.parse(localStorage.getItem(key));
        if (val && typeof val.title === "string" && Array.isArray(val.ingredients)) {
          validRecipes.push({ key, title: val.title });
        }
      } catch (err) {
        console.warn(`⚠️ Could not parse ${key}`, err);
      }
    });

    setRecipes(validRecipes);
  }, []);

  const handleDelete = (key) => {
    if (window.confirm(`Delete this recipe?`)) {
      localStorage.removeItem(key);
      setRecipes(recipes.filter((r) => r.key !== key));
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 text-gray-900 font-satoshi">
      {/* Header Bar */}
      <header className="flex items-center justify-between bg-[#14523F] text-white px-6 py-4 shadow">
        <div className="flex items-center gap-3">
          <img src="/Toque_Logo_White.png" alt="Toque Logo" className="h-10 w-10" />
          <h1 className="text-2xl font-bold text-white">Recipe Builder</h1>
        </div>

        {/* Tabs Navigation */}
        <nav className="flex gap-6">
          <button onClick={() => navigate("/")} className="text-sm font-medium text-white border-b-2 border-white pb-1 flex items-center gap-2">
              <FileText size={16} /> Recipes
          </button>
          <button onClick={() => navigate("/ingredients")} className="text-sm font-medium text-white hover:text-gray-200 flex items-center gap-2">
              <Apple size={16} /> Ingredients
          </button>
          <button onClick={() => navigate("/menus")} className="text-sm font-medium text-white hover:text-gray-200 flex items-center gap-2">
              <BookOpen size={16} /> Menus
          </button>
          <button onClick={() => navigate("/books")} className="text-sm font-medium text-gray-600 hover:text-blue-600">
            Recipe Books
          </button>
        </nav>
      </header>

      <main className="p-6 space-y-6">
        <div className="text-xl font-semibold">Recipes</div>

        <div className="space-y-2">
          {recipes.map((recipe, index) => (
            <div
              key={recipe.key}
              className="flex items-center justify-between bg-white px-4 py-3 rounded shadow hover:shadow-md transition"
            >
              <button
                className="text-left font-medium hover:underline"
                onClick={() => navigate(`/recipe?title=${encodeURIComponent(recipe.title)}`)}
              >
                {recipe.title}
              </button>

              <div className="relative">
                <button
                  onClick={() =>
                    setMenuOpenIndex(index === menuOpenIndex ? null : index)
                  }
                  className="p-2 hover:bg-gray-200 rounded-full"
                >
                  <MoreVertical size={20} />
                </button>

                {menuOpenIndex === index && (
                  <div className="absolute right-0 mt-2 w-52 bg-white shadow-lg rounded-md border z-10">
                    <ul className="text-sm text-gray-700">
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <FileText size={16} /> Add to Recipe Book
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <Upload size={16} /> Send a copy
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <FileText size={16} /> Make a copy
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <Upload size={16} /> Export
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <Printer size={16} /> Print
                      </li>
                      <li
                        onClick={() => handleDelete(recipe.key)}
                        className="px-4 py-2 hover:bg-red-100 cursor-pointer text-red-600 flex items-center gap-2"
                      >
                        <Trash2 size={16} /> Delete
                      </li>
                    </ul>
                  </div>
                )}
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
}

export default Dashboard;
